    <script>
        const doc = document.getElementsByTagName("embed");
        const src = doc[0].getAttribute("src")
        const URIEncoded = src.split("base64,")

        // base64 string
        const base64String = decodeURIComponent(URIEncoded[1])

        // Decode base64 string to binary string
        const binaryString = atob(base64String)

        const uint8Array = new Uint8Array(binaryString.length);
        for (let i = 0; i < binaryString.length; i++) {
            uint8Array[i] = binaryString.charCodeAt(i);
        }

        // Convert binary string to PDF Blob
        const pdfBlob = new Blob([uint8Array], { type: 'application/pdf' });
        const filename = 'document.pdf';

        if (typeof window.navigator.msSaveBlob !== 'undefined') {
            // IE workaround
            window.navigator.msSaveBlob(pdfBlob, filename);
        } else {
            const pdfUrl = URL.createObjectURL(pdfBlob);
            const anchor = document.createElement('a');
            anchor.href = pdfUrl;
            anchor.download = filename;
            document.body.appendChild(anchor);
            anchor.click();
            document.body.removeChild(anchor);
        }

    </script>
